import React, { useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <nav>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/explore">Explore</Link></li>
                    <li><Link to="/my-quotes">My Quotes</Link></li>
                </ul>
            </nav>
        </header>
    )
}

export default Header
